import React from 'react';
import { Heading, Flex, Text, Image } from "rebass";
import { Hero, Feature } from "react-landing-page";
import { Box, Typography, Grid } from '@material-ui/core';
import Sunflower from './Sunflower';
import {
    makeStyles, createStyles, Theme,
  } from '@material-ui/core/styles';
import './background.css';

const useStyles = makeStyles((theme: Theme) => createStyles({
fullBannerBox: {
    background: 'linear-gradient(to bottom, #F4F4F9 20%, #fff 80%)',
},
bannerBox: {
    height: '60vh',
    padding: '5vh',
    textAlign: 'center',
    marginLeft: '9vh',
    [theme.breakpoints.down('md')]: {
        marginLeft: '8vh',
        height: '60vh',
    },
    [theme.breakpoints.down('sm')]: {
        marginLeft: '5vh',
        height: '40vh',
    },
    [theme.breakpoints.down('xs')]: {
        marginLeft: '2vh',
        height: '30vh',
    },
},
banner: {
    width: '70%',
    [theme.breakpoints.down('md')]: {
        width: '100%',
    },
},
subtitle: {
    fontSize: '3vh',
    color: 'rgb(0,0,0,0.8)',
    marginBottom: '3vh',
    [theme.breakpoints.down('sm')]: {
        fontSize: '2vh',
    },
},
logoBox: {
    paddingTop: '3vw',
    [theme.breakpoints.down('md')]: {
        paddingTop: '5vw',
    },
    [theme.breakpoints.down('sm')]: {
        paddingTop: '10vw',
    },
},
goalsBox: {
    // background: 'linear-gradient(to right, #F4F4F9 20%, #fff 80%)',
    padding: '8vh',
},
}));  
export default function Home(props: any) {
    const classes = useStyles(undefined);
    return (
        <Box>
            <Box className={classes.fullBannerBox}>
                <Box className={classes.logoBox}>
                    <Heading textAlign="center" fontFamily={"inherit"} fontWeight={100}>
                        <Sunflower/>
                    </Heading>
                </Box>
                <Box>
                    <Typography className={classes.subtitle} style={{ textAlign: 'center' }}>
                        A cross-platform web app for digital learning
                    </Typography>
                </Box>
                <Box className={classes.bannerBox}>
                    <img className={classes.banner} src="/home/mockup.png" alt="mockup" />
                </Box>
            </Box>
            <Hero>
                <Flex width={[1, 2/3]} alignItems="center" flexDirection="column">
                    {/* <Heading fontFamily={"inherit"} fontSize={[40, 50]} fontWeight={500} textAlign="center">WHY <Sunflower/> ?</Heading> */}
                    <Flex flexDirection="row" justifyContent="space-between" flexWrap="wrap">
                        <Feature icon="ðŸ’¡" description="Designed to improve teaching and learning efficiency.">
                            Performance
                        </Feature>
                        <Feature icon="ðŸ’¬" description="Enhance communication through group discussion and personalised interaction.">
                            Build relationships 
                        </Feature>
                        {/* <Feature icon="ðŸ””" description="Detect potential mental health symptoms.">
                            Alert
                        </Feature> */}
                        <Feature icon="ðŸŽ¯" description="Minimalist interface design with simple English.">
                            Easy to use
                        </Feature>
                        <Feature icon="ðŸ“±" description="Use anytime, anywhere, on any device.">
                            Responsive
                        </Feature>
                    </Flex>
                </Flex>
                {/* <Grid width="100%" minHeight="100vh" flexDirection="row" padding={20} flexWrap="wrap-reverse" justifyContent="space-around"> */}
                <Grid container style={{ padding: '20vh'}}>
                    <Grid item xs={12} md={7}>
                        <Heading fontFamily={"inherit"} fontSize={[50]} fontWeight={500} paddingBottom="5vh" color="rgb(153, 193, 185)">Our Client</Heading>
                        <Heading fontFamily={"inherit"} fontSize={[30]} fontWeight={500} paddingBottom="2vh">EO1 Ltd Pty - Engage Online</Heading>
                        <Text fontFamily={"inherit"} fontSize={20}>Engage Online is a fully-loaded digital agency with the head office located in the beautiful city of Wollongong. Engage Online works with a wide range of businesses, bringing diverse challenges and solutions. </Text>
                    </Grid>
                    <Grid item xs={12} md={5} style={{ textAlign: 'right' }}>
                        <img src="eo1.png" alt="eo1" width="80%" />
                    </Grid>
                </Grid>
                <Flex className={classes.goalsBox} marginTop={150} alignItems="center" flexDirection="column">
                {/* <Flex width={[1, 2/3, 1/2]} alignItems="center" flexDirection="column"> */}
                    <Heading fontFamily={"inherit"} fontSize={[40, 50]} fontWeight={500}>Project Team</Heading>
                    <Flex width={[1]} justifyContent="center" marginTop={30}>
                        <Typography style={{fontSize: 26, textAlign: "center"}}>
                            <b>Developing Nations Dashboard</b> is a project owned by <a style={{ textDecoration: 'none' }} href="https://engageonline.com.au/">EO1 PTY LTD</a>.
                            <div>aaaa</div>
                        </Typography>
                    </Flex>
                </Flex>
            </Hero>
        </Box>
    )
}
